import React from 'react';
import './App.css';
import Bulle from './components/Bulle';

const customisationPersonnelle = ['Ceci est ma customisation'];
const prixAssociation = 5;
const asblInfo = 'Ceci est une présentation de l\'asbl';


class App extends Component {
    constructor(props) {
        super(props);
        this.state = { }
    }



    render() { 
    return ( 
        <div>
            <Bulle  />
            <Avatar 
              avatar={this.state.avatar}
              pseudo={this.state.pseudo}

              selectImageAvatar={(image) => this.handleClick(image)} 
              selectNameAvatar={(event) => this.myChangeName(event)}
              selectIdAvatar={(event) => this.sendUserToGamePage(event)}

              isDrawer={this.state.isDrawer} />
        </div>
    );
  }
}

export default App;
